data.forEach(function(d,i) {d.values.forEach(function(v) {v.series=i;});})

var info=[{key:"unstacked",text:""},{key:"stacked",text:""}];

var mode=1;

var view=0;

var currentView=0;
var nextView;
var w=600,h=400;

var svg=d3.selectAll("#chart").append("svg:svg").attr("height",h).attr("width",w);

var years=71;
var maxA=70; // 70 GtCO2
var maxB=70; // 70 GtCO2

d3.select("#stacked").on("change",function() {mode=1-mode;transitionTo(mode);})


var x=d3.scale.linear().domain([1980,2050]).range([0,w-155]);
var y=d3.scale.linear().domain([0,maxA]).range([h-20,100]);

var lineS=new Array;
lineS[0]=d3.svg.area().x(function(d) {return x(d.key);}).y1(function(d) {return y(d.values[0].y);}).y0(function(d) {return y(d.values[0].y0);});
lineS[1]=d3.svg.area().x(function(d) {return x(d.key);}).y1(function(d) {return y(d.values[1].y);}).y0(function(d) {return y(d.values[1].y0);});

function segment(i,j,stacked) {
	if(i>=data[j].values.length-1) {return "";}
	else {
	x1=~~x(data[j].values[i].key);
	x2=~~x(data[j].values[i].key);
	//console.log(j+" "+i+" "+(i+1)+":"+data[j].values[i+1]);
	x3=x(data[j].values[i+1].key);
	x4=x(data[j].values[i+1].key);
	y1=y(data[j].values[i].values[stacked].y0);
	y2=y(data[j].values[i].values[stacked].y);
	y3=y(data[j].values[i+1].values[stacked].y);
	y4=y(data[j].values[i+1].values[stacked].y0);
	var poly=[[x1,y1],[x2,y2],[x3,y3],[x4,y4]];
	return d3.svg.line().x(function(d) {return d[0];}).y(function(d) {return d[1];})(poly)+"Z";}
}

var xAxis = d3.svg.axis()
    .scale(x)
    .ticks(8)
    .tickSize(6, 3, 0)
    .tickFormat(d3.format(""));


